;; **
;;; # Multiplicative Cycles In The Multiplicative Group of Integers Modulo N
;;; Imagine taking a arbitrary number.
;; **

;; @@
(require '[mult-mod.core :refer :all]
         '[ubergraph.core :as uber]
         '[gorilla-repl.image :refer [image-view]])
									
(let [arbitrary-number 7]
  (image-view
   (ubergraph->png
    (uber/multigraph arbitrary-number))))
;; @@
